import React from 'react'
import NavDrawer from '../components/NavDrawer'
import HomePage from '../components/HomePage'

export default function Dashboard() {
    return (
        <div>
            <NavDrawer/>
            <Container maxWidth="sm">
                <HomePage/>
            </Container>
        </div>
    )
}
